import React from 'react'
import Input from '../Input/Input'

class Upload extends React.Component {
    render() {
        return (
            <div>
                <a href="">Назад</a>
                <Input label="Имя" placeholder="Введите ваше имя"/>
            </div>
        ) 
    }
}

export default Upload
